$(document).ready(function(a){$(".search-panel .dropdown-menu").find("a").click(function(c){c.preventDefault();var d=$(this).attr("href").replace("#","");var b=$(this).text();$(".search-panel span#search_concept").text(b);$(".input-group #search_param").val(d)});$(window).scroll(function(){var b=$(window).scrollTop();if(b>=150){$("#topNav").addClass("nav-shrink")}else{$("#topNav").removeClass("nav-shrink")}})});